import React from 'react';
import { View } from 'react-native';
import AppText from '../../components/text/AppText';
import colors from '../../styles/colors';
import { styles } from '../../styles/styles';
import { AntDesign } from '@expo/vector-icons';

const PaymentsScreen = () => {

    const { bg_light, container, p_15, row, row_center_x_between, rounded } = styles;
    const { darkGrey, green, secondary } = colors;

    return (
        <View style={container}>
            <View style={[bg_light, p_15, row_center_x_between, rounded]}>
                <View style={[row]}>
                    <AntDesign name="checkcircle" size={24} color={green} />
                    <AppText bold>2022 FEB 22</AppText>
                </View>
                <AppText as="h3" bold color={secondary}>20,000</AppText>
            </View>
        </View>
    );
}

export default PaymentsScreen;

